import React from 'react';
import Titles from './components/Titles';
import Form from './components/Form';
import Weather from './components/Weather';

const API_KEY = "6f87714489461325e1b1e8a23785e29d";

class App extends React.Component {
    getWeather = async (e) => {
        e.preventDefault();
        const api_call = await fetch('http://api.openweathermap.org/data/2.5/weather?q=$Manchester,UL&appid=${6f87714489461325e1b1e8a23785e29d}&units=metric');
        const data = await api_call.json();
        console.log(data);
    }
    render() {
        return (

            <div>
                <Titles />
                <Form getWeather={this.getWeather}/>
                <Weather />
            </div>
        );
    }
}

export default App;
